import React from 'react'
import product from '../components/product'
import {Row, Col} from "react-bootstrap"

const HomeScreen = () =>
{
    return(
        <div>
        <h1> Latest products</h1>
        <Row>{product.map(products => 
            (
                <Col sm={12} md={6} lg={4} xl={3}>
                    <h3>{products.name}</h3>
                    </Col>
            ))}
        </Row>
        </div>
    
    )
} 

export default HomeScreen
